import React from 'react';
import waterLeaf from './components/images/waterLeaf.jpeg';
import './App.css';
import { Route } from 'react-router-dom'
import Home   from './components/Home'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          Our App
        </h1>
        <img alt="water leaf"src={waterLeaf}>
        </img>
      </header>
      <Route exact path="/" component={Home}/>
    </div>
  );
}

export default App;
